(3, 'Home2', 'WHY ASSIGN HOLDINGS Ltd.?', 'Art is an expression of one’s deepest feelings in a distinctive pattern; a true masterpiece emerges only when the creator demonstrates unwavering commitment. We, at our organization (REHAB Member), believe that construction is not merely the act of building a structure—it is an art. Every corner of a building reflects the passion and dedication of its creators.\r\n\r\nEstablished in 2007, the company has grown into one of the fastest-expanding real estate developers in the country. With a clear mission, it strives to transform urban living by offering functional and aesthetically refined residential and commercial spaces comparable to those found in the developed world.', '26d711cd5595a3e355b72a25880f6974.jpg', 1, '');
