INSERT INTO `pages` (`id`, `name`, `title`, `description`, `metatitle`, `metakeyword`, `metadescription`, `banner`, `status`, `content`) VALUES
(1, 'ourstory', 'About us', 'Our Story', 'Our Story', 'Our Story', 'Our Story', '4a87bf9c545df14ed5fbc2ed0ea8213f.jpg', 1, '<section class=\"our-background\" id=\"background\">\r\n<div class=\"clearfix\">\r\n<div class=\"col-sm-12\" style=\"text-align:center; margin-top: 50px;\"><div><img width=\"200px\" src=\"https://assignholdings.com/asset/images/contents/Assign-Logo-1.png\"/></div></div>\r\n\r\n<div class=\"col-sm-12\">\r\n<div class=\"content-holder no-before-after bg-white section-gap\">\r\n\r\n<p style=\"width: 83%; margin: 0px auto; text-align: center;\">Art is an expression of one’s deepest feelings in a distinctive pattern; a true masterpiece emerges only when the creator demonstrates unwavering commitment. We, at our organization <b> (REHAB Member) </b> , believe that construction is not merely the act of building a structure—it is an art. Every corner of a building reflects the passion and dedication of its creators.<br />\r\n<br />\r\n<b> ASSIGN HOLDINGS LTD. </b> , Established in <b> 2007 </b> , the company has grown into one of the fastest-expanding real estate developers in the country. With a clear mission, it strives to transform urban living by offering functional and aesthetically refined residential and commercial spaces comparable to those found in the developed world.<br />\r\n<br />\r\nWe lent our ears to the latent voice of the choosy individuals who want to have a space with sufficient car parking facility, latest security options and safety precaution in a prestigious location. Our projects are being built accommodation those adequate facilities with the design by the well experienced renowned Architects.<br />\r\n<br />\r\nUnder the enterprising leadership of highly experienced professionals across diverse fields, encompassing development, management, and construction disciplines, every effort is dedicated to fulfilling the mission of AHL. It is this commitment and expertise that empower us to proudly declare: “Let’s make your dream come true.” </p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n\r\n<section class=\"who-we-are-section section-gap bg-grey pb-40\" id=\"who-we-are\" style=\"background-image: url(\'http://demo.assignholdings.com/asset/images/mission-vission.jpg\'); background-position: 50% -21.16px;\">\r\n<div class=\"container-fluid\">\r\n<div class=\"mb-40\">\r\n<h2 class=\"heading-primary text-white\" style=\"text-align: center; color:rgba(174, 238, 88);\">MISSION & VISSION</h2>\r\n</div>\r\n\r\n<div class=\"row\">\r\n\r\n\r\n<div class=\"col-sm-12 col-md-12\" style=\"text-align:center; height: 480px;\">\r\n<div class=\"mt-20 content-holder\">\r\n<p style=\"color: #ffffff;\">To offer a global touch, maintaining Bangladeshi culture, in living and working place with utmost uncompromising service to clients and value of money.<br />\r\n&nbsp;<br />\r\nTo ensure a smooth upward-reasonable trend of return of investment.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n'),
(2, 'visionmission', 'About Us', 'Mission & Vission', 'Mission & Vission', 'about us, Mission & Vission', 'Mission & Vission', '5d855959d31dbcc226ccbcddb8fc28d6.jpg', 1, ''),
(5, 'boardofdirectors', 'ABOUT US', 'BOARD OF DIRECTORS', 'BOARD OF DIRECTORS', 'BOARD OF DIRECTORS', 'BOARD OF DIRECTORS', 'd24ccb31300af98fd68081cb3158f87e.jpg', 1, '<section id=\"board-of-directors\" class=\"pb-0 pt-70 features_amenities no-bg\">\n	<div class=\"container-fluid\">\n		<div class=\"mb-60\">\n			<h2 class=\"heading-primary text-off-white\">\n							</h2>\n		</div>\n						<div class=\"top-management-members row mb-80 image-align-left\">\n				<div class=\"col-sm-6 col-md-5 \">\n					<div class=\"image-box-holder\">\n						<div class=\"image-box no-shadow \" style=\"background-image: url(http://demo.assignholdings.com/asset/frontend_template/admin/uploads/page/board-of-directors/1494751734cVBBI.jpg);\">\n						</div>\n					</div>\n				</div>\n				<div class=\"col-sm-6 col-md-6 image-box-side-content\">\n					<div class=\"feature-details-box-wrapper mb-50\">\n						<div class=\"feature-details mt-20\">\n							<div class=\"mb-30\">\n								<h3 class=\"board-member-title text-uppercase\">MR. KHONDOKER MONIR UDDIN</h3>\n\n								<h4 class=\"board-member-desig text-uppercase\">MANAGING DIRECTOR</h4>\n							</div>\n							<div class=\"line line--full line--1 line--grey mb-20\"></div>							<div class=\"board-member-details\">\n								<p>A distinguished businessperson and perceptive entrepreneur, Mr. Khondoker Monir Uddin, the founder promoter of Shanta, opts to do business by providing world-class products and services in our country.&nbsp;With his visionary leadership and keen business knowledge, Shanta drives forward to not only provide superior quality products, but to demonstrate unparalleled foresight by developing projects which are the epitome of modern architecture and comfortable living.<br />\n<br />\nMr. Monir completed his Bachelors with Honours&nbsp;and Masters degrees from the Department of Accounting, University of Dhaka.&nbsp;Over the past three decades he has established Shanta as one of the leading corporate houses in Bangladesh,&nbsp;with investments in diversified sectors,&nbsp;and thus has been continually recognized as a commercially important person (CIP) of the country. Mr. Monir is also a founder and&nbsp;Managing Director of the prestigious&nbsp;STS Group -&nbsp;which revolutionized the healthcare and education sectors&nbsp;of the country,&nbsp;as well as a sponsor&nbsp;Director and former Chairman of Dhaka Bank Limited.</p>\n							</div>\n						</div>\n					</div>\n				</div>\n			</div>\n										<div class=\"top-management-members mb-60 row image-align-right\">\n				<div class=\"col-sm-6 col-md-5 col-sm-push-6 col-md-push-7 \">\n					<div class=\"image-box-holder\">\n						<div class=\"image-box no-shadow \" style=\"background-image: url(http://demo.assignholdings.com/asset/frontend_template/admin/uploads/page/board-of-directors/1496057384YcPuD.jpg);\">\n						</div>\n					</div>\n				</div>\n				<div class=\"col-sm-6 col-md-6 col-sm-pull-6 col-md-pull-5 image-box-side-content text-right text-left-xs\">\n					<div class=\"feature-details-box-wrapper mb-50\">\n						<div class=\"feature-details mt-20\">\n							<div class=\"mb-30\">\n								<h3 class=\"board-member-title text-uppercase\">MR. SAIF KHONDOKER</h3>\n								<h4 class=\"board-member-desig text-uppercase\">DIRECTOR</h4>\n							</div>\n							<div class=\"line line--full line--1 line--grey mb-20\"></div>\n							<div class=\"board-member-details\">\n								<p><span style=\"font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; text-align: center;\">Mr. Saif Khondoker&nbsp;completed his BBA with a specialization in Strategic Management from the University of Toronto, and his MBA from the prestigious Rotman School of Management, University of Toronto.&nbsp;Under his leadership,&nbsp;Shanta strives to continuously enhance its operational efficiency, strategic marketing and branding, and implement state-of-the-art technologies. His focus also&nbsp;lies in driving&nbsp;product innovation by incorporating modern features into Shanta projects, which truly differentiate it from competitors.<br />\n<br />\nApart from his active involvement in the management and decision making of the company, he has also spearheaded the formation of Shanta Home Systems - an authorized dealership of Control 4 automation products, offering the latest in home automation and entertainment solutions. He is also a Director of the&nbsp;Delta Life Insurance Company Ltd, and Managing Director of Shanta Asset Management Ltd&nbsp;and Shanta Technologies Ltd.&nbsp;&nbsp;</span></p>\n							</div>\n						</div>\n					</div>\n				</div>\n			</div>\n							</div>\n</section>'),
(6, 'managementteam', 'ABOUT US', 'MANAGEMENT TEAM', 'MANAGEMENT TEAM', 'MANAGEMENT TEAM', 'MANAGEMENT TEAM', 'a6b7edca4452de0f0764b0912b44ab37.jpg', 1, '<section class=\"pb-0 pt-70 features_amenities no-bg\" id=\"habibul-basit\">\n<div class=\"container-fluid\">\n<div class=\"mb-60\">\n<h2 class=\"heading-primary text-off-white\">CEO</h2>\n</div>\n\n<div class=\"top-management-members row image-align-left\">\n<div class=\"col-sm-6 col-md-5 \">\n<div class=\"image-box-holder\">\n<div class=\"image-box no-shadow \" style=\"background-image: url(http://demo.assignholdings.com/asset/frontend_template/admin/uploads/page/management-team2/1494761244DbJXo.jpg);\">&nbsp;</div>\n</div>\n</div>\n\n<div class=\"col-sm-6 col-md-6 image-box-side-content\">\n<div class=\"feature-details-box-wrapper mb-50\">\n<div class=\"feature-details mt-20\">\n<div class=\"mb-30\">\n<h3 class=\"board-member-title text-uppercase\">MR. M HABIBUL BASIT</h3>\n\n<h4 class=\"board-member-desig text-uppercase\">CHIEF EXECUTIVE OFFICER</h4>\n</div>\n\n<div class=\"line line--full line--1 line--grey mb-20\">&nbsp;</div>\n\n<div class=\"board-member-details\">Mr. M Habibul Basit, a well seasoned professional with an illustrious track record, joined Shanta in October 2015 taking up the role of Chief Executive Officer. Prior to joining, Mr. Basit held the position of Managing Director at Archroma Bangladesh Limited for two years, and Chief Operating Officer of Rahimafrooz Accumulators Limited from November 2008 till January 2013. Before Rahimafrooz Mr. Basit worked in Toronto, Canada for Strip Tech, a company specializing in metal stripping and sand blasting.<br />\n<br />\nMr. Basit worked for Rekitt Benckiser in Bangladesh as a Sales Director from January 1998 to July 2001, before which he worked as a National Sales Manager for New Zealand Milk Products, Bangladesh for a span of 4 years. The start of Mr. Basit&rsquo;s illustrious career was at British American Tobacco, Bangladesh, where he started as a Trainee District Sales Officer in 1985 and went on to become Area Sales &amp; Marketing Manager by 1991.<br />\n<br />\nMr. Basit completed his Masters of Commerce in Marketing from the University of Dhaka, following which he acquired a Post Graduate Diploma in &ldquo;Marketing Management and Physical Distribution&rdquo; from Netherlands International Institute for Executive Development, Holland.</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</section>\n\n<section class=\"section-gap pb-0 pt-80\">\n<div class=\"container-fluid\">\n<div class=\"mb-60\">\n<h2 class=\"heading-primary text-off-white\">Senior Management</h2>\n</div>\n\n<div class=\"row member-list\">\n<div class=\"member-list-item custom-col-xs-6 col-sm-6 col-md-4\">\n<div class=\"member-thumb-wrapper pb-60 mb-30\"><img alt=\"\" src=\"http://demo.assignholdings.com/asset/frontend_template/admin/uploads/page/senior-management1/14947614671fPn4.jpg\" /></div>\n\n<div class=\"member-info\">\n<div class=\"top-info\">\n<h3 class=\"board-member-title text-uppercase\">MR. MD. MUJIBUR RAHMAN</h3>\n\n<h4 class=\"board-member-desig text-uppercase\">EXECUTIVE DIRECTOR</h4>\n</div>\n\n<div class=\"details-info\">Mr. Md. Mujibur Rahman is a seasoned management professional with over 35 years of extensive experience in managing renowned local and multinational organizations.<br />\n<br />\nHe has been a part of SHL since inception and is currently the Executive Director of Procurement and Legal.</div>\n<button class=\"member-details-expand\"></button></div>\n</div>\n\n<div class=\"member-list-item custom-col-xs-6 col-sm-6 col-md-4\">\n<div class=\"member-thumb-wrapper pb-60 mb-30\"><img alt=\"\" src=\"http://demo.assignholdings.com/asset/frontend_template/admin/uploads/page/senior-management1/1494761748RzUae.jpg\" /></div>\n\n<div class=\"member-info\">\n<div class=\"top-info\">\n<h3 class=\"board-member-title text-uppercase\">MR. MIR MAHMUD ALI DILIP</h3>\n\n<h4 class=\"board-member-desig text-uppercase\">EXECUTIVE DIRECTOR</h4>\n</div>\n\n<div class=\"details-info\">Mr. Mir Mahmud Ali Dilip is a stellar real estate professional with a broad experience of over 34 years. His leadership has resulted in numerous signature projects, such as the world class Apollo Hospitals Dhaka, International School Dhaka (ISD) which is the only International Baccalaureate (IB) School of the country, Delhi Public School, Dhaka. Digonto - the first true condominium of Bangladesh, The Glass House &ndash; The first steel and glass structure and many more.<br />\n<br />\nHe is currently the Executive Director of Project Operations at SHL.</div>\n<button class=\"member-details-expand\"></button></div>\n</div>\n\n<div class=\"clearfix visible-sm visible-custom-xs \">&nbsp;</div>\n\n<div class=\"member-list-item custom-col-xs-6 col-sm-6 col-md-4\">\n<div class=\"member-thumb-wrapper pb-60 mb-30\"><img alt=\"\" src=\"http://demo.assignholdings.com/asset/frontend_template/admin/uploads/page/senior-management1/1494761881Ir5vW.jpg\" /></div>\n\n<div class=\"member-info\">\n<div class=\"top-info\">\n<h3 class=\"board-member-title text-uppercase\">MR. MD. ANISUL HAQUE, FCMA</h3>\n\n<h4 class=\"board-member-desig text-uppercase\">CHIEF FINANCIAL OFFICER</h4>\n</div>\n\n<div class=\"details-info\">Mr. M. Anisul Haque is a result oriented finance professional with over 18 years of progressive and diverse accomplishments in renowned local and multinational organizations.<br />\n<br />\nHe is currently practicing as a Cost and Management Accountant and Consultant and is a Fellow Member (FCMA) of The Institute of Cost and Management Accountants of Bangladesh (ICMAB).</div>\n<button class=\"member-details-expand\"></button></div>\n</div>\n</div>\n</div>\n</section>\n\n<section class=\"section-gap pb-0 pt-80\">\n<div class=\"container-fluid\">\n<div class=\"mb-60\">\n<h2 class=\"heading-primary text-off-white\">Our Team</h2>\n</div>\n\n<div class=\"row member-list\">\n<div class=\"member-list-item custom-col-xs-12 col-sm-12 col-md-12\">\n<div><img alt=\"\" src=\"http://demo.assignholdings.com/asset/frontend_template/backend/web/kcfinder/upload/images/Mostansir-71%20copy.jpg\" style=\"width: 1400px;\" /></div>\n\n<p class=\"mt-60\">The hidden sutra for successfully turning dreams into reality is our regular practice. One segment of our human force is deployed to bridge the extreme aspirations of our consumers, while the other segment actually builds the dreams.<br />\n<br />\nTo achieve the ultimate mission of maximizing lifestyle and potential, Shanta Holdings gathers widely experienced professionals, trained both at home and abroad. We have more than 200 full-time employees, who represent a vast spectrum of development, management and construction disciplines. Well-balanced personnel from both business and technical backgrounds are continuously thriving to fulfil the mission of Shanta.</p>\n</div>\n</div>\n</div>\n</section>\n'),
(7, 'companies', 'ABOUT US', 'COMPANIES', 'COMPANIES', 'COMPANIES', 'COMPANIES', 'b312fef348637b6b516a92bd36ffe18c.jpg', 1, '<section class=\"pt-80 pb-60 bg-light-grey\" id=\"companies\">\n<div class=\"container-fluid\">\n<div class=\"row\">\n<div class=\"col-sm-6 mb-30\">\n<h2 class=\"heading-primary\">Companies</h2>\n\n<p>Shanta Holdings Ltd (SHL) is a key founding member and major stakeholder of the STS Group - the promoter of the world class Apollo Hospitals Dhaka, International School Dhaka (ISD) and the Delhi Public Schools, Dhaka.<br />\n<br />\nShanta Securities Ltd. and Shanta Asset Management, subsidiaries of SHL, were established with the aim of setting higher standards in the financial services sector.&nbsp;</p>\n</div>\n\n<div class=\"col-sm-6\">\n<ul class=\"row business-units-list\">\n	<li class=\"custom-col-xs-6 col-sm-6 col-md-4\">\n	<div class=\"caption-wrapper\" style=\"background-color: #AAA000\">\n	<div class=\"caption\"><a class=\"bg-cover-center\" href=\"http://www.stsgroupbd.com/\" style=\"background-image: url(http://demo.assignholdings.com/asset/frontend_template/admin/uploads/page/business-units/1496922017OYdg9.png);\" target=\"_blank\">STS Group</a></div>\n	</div>\n	</li>\n	<li class=\"custom-col-xs-6 col-sm-6 col-md-4\">\n	<div class=\"caption-wrapper\" style=\"background-color: #AAA000\">\n	<div class=\"caption\"><a class=\"bg-cover-center\" href=\"http://www.shantasecurities.com/\" style=\"background-image: url(http://demo.assignholdings.com/asset/frontend_template/admin/uploads/page/business-units/14969220956YMcY.png);\" target=\"_blank\">Shanta Securities</a></div>\n	</div>\n	</li>\n	<li class=\"custom-col-xs-6 col-sm-6 col-md-4\">\n	<div class=\"caption-wrapper\" style=\"background-color: #AAA000\">\n	<div class=\"caption\">&nbsp;</div>\n	</div>\n	</li>\n</ul>\n</div>\n</div>\n</div>\n</section>\n'),
(8, 'csr', 'ABOUT US', 'CSR', 'CSR', 'CSR', 'CSR', '6b434801628dc2d400ca316a6dd6c215.jpg', 1, '<section class=\"pb-0 pt-70 features_amenities no-bg\">\n<div class=\"container-fluid\">\n<div class=\"mb-60\">\n<h2 class=\"heading-primary text-off-white\">Corporate Social Responsibility</h2>\n</div>\n\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"vertical-align:top;\">\n	<tbody>\n		<tr>\n			<td style=\"width:470px\"><img alt=\"\" src=\"http://demo.assignholdings.com/asset/frontend_template/backend/web/kcfinder/upload/images/Existing%20hospital%20building(2).jpg\" /><br />\n			<br />\n			<img alt=\"\" src=\"http://demo.assignholdings.com/asset/frontend_template/backend/web/kcfinder/upload/images/Auto%20Hematology%20analizer(2).jpg\" /><br />\n			<br />\n			<img alt=\"\" src=\"http://demo.assignholdings.com/asset/frontend_template/backend/web/kcfinder/upload/images/CWCH11.jpg\" /><br />\n			&nbsp;</td>\n			<td>&nbsp;&nbsp;</td>\n			<td style=\"padding-left:100px; vertical-align: top;\">As part of its Corporate Social Responsibility (CSR), Shanta Holdings Ltd. is the main founder and primary financier of the Centre for Woman and Child Health (CWCH). It is a fully philanthropic non-profit hospital located in&nbsp; Beron , Ashulia right on the&nbsp; Tongi -Ashulia-EPZ bypass road.&nbsp;The hospital mostly treats poor mothers and children of the locality.&nbsp;The&nbsp; centre &nbsp;runs and operates under a trust chaired by renowned national pediatrician Prof. Dr. M Q-K Talukder. Mr. Khondoker Monir Uddin, the Managing Director of Shanta, is a member of the Board of Trustees who acts as the chief advisor and counselor to the trust.<br />\n			<br />\n			The &nbsp; centre &nbsp;&nbsp;has &nbsp;been in operation since 2004, occupying a land area of 12 bighas with a current built up area of approximately 30,000 &nbsp; sft &nbsp;. &nbsp;It caters mainly outpatient services 24 hours x 7 days a week. There are 35 beds, an Operation Theatre, and over 175 staff and 70 physicians of various specialties including a number of senior consultants. It serves about 18,000 to 20,000 patients every month and is also equipped with a modern diagnostic lab. The center runs using integrated software and mostly on paperless operations.&nbsp;<br />\n			<br />\n			CWCH was established with the objective to provide healthcare services to the poor and promote the overall development of women and children with particular emphasis on their health and nutrition. The&nbsp; centre &nbsp;has research programs to identify the sufferings of women and children and suggest the&nbsp; Government to &nbsp;address the same issues nationally to achieve the MDG set in terms of reducing child mortality and making other improvements. A couple of research findings have been submitted to the Government and also published in international medical journals with appreciations.<br />\n			<br />\n			The center has adopted a master plan to construct a 300-bed&nbsp; multi care &nbsp;inpatient hospital, a Nursing College and also a Medical College. The first phase of the expansion is already in progress and the center hopes to commence full operations in the near future.&nbsp;<br />\n			<br />\n			<a href=\"http://cwchbd.org/\">http://cwchbd.org</a></td>\n		</tr>\n	</tbody>\n</table>\n\n<p><br />\n<br />\n&nbsp;</p>\n</div>\n</section>\n'),
(9, 'why', 'WHY SHANTA HOLDINGS', 'OUR STRENGTH', 'OUR STRENGTH', 'OUR STRENGTH', 'OUR STRENGTH', '349c40cdc0ac5db801dc403e84514ac5.jpg', 1, '<section class=\"section-gap bg-cover-center\" id=\"why-shanta-holdings\">\n<div class=\"container-fluid\">\n<div class=\"row\">\n<div class=\"col-sm-12 col-md-12\">\n<h2 class=\"heading-primary \">WHY SHANTA HOLDINGS</h2>\n<br />\n<strong>WHY CHOOSE SHANTA HOLDINGS?</strong><br />\n<br />\nShanta aspires to weave an unprecedented experience of fine living cocooned in comfort for you. It&rsquo;s the statement of prestige and elegant Architecture that sets us apart. We delve deep into your dwelling needs and make sure those are met to the minutest detail. Every day is a new opportunity for us to master the art of fine living, to reinvent our craftsmanship that complements your lifestyle and fine taste. With each of our creations, Shanta continues to raise the bar of setting a golden standard of excellence. We create your personal kingdom of grandeur, wrapped in the comfort of home.<br />\n<br />\n<br />\n<strong>PRESTIGIOUS LANDMARKS</strong><br />\n<br />\nShanta Holdings Limited (SHL) has emerged as the leading Real Estate developer with a mission to change the lifestyle of city dwellers, by providing functional and aesthetical living &amp; working spaces that are comparable internationally. Our philosophy is to build prestigious commercial &amp; residential complexes in prime locations, which are true landmarks on the skyline. Utmost consideration is given to the areas of architecture, lifestyle facilities, safety (physical, fire &amp; electro mechanical), luxury and comfort.<br />\n<br />\n&nbsp;<br />\n<strong>SUPERIOR QUALITY AND ARCHITECTURE</strong><br />\n<br />\nQuality is our core principle and architecture is our passion. We&nbsp;endeavor&nbsp;to offer global standard architectural design solutions whilst keeping the local culture in mind. We believe that every project is unique; hence unique architectural requirements may arise. Thus, we work very closely with a panel of the leading Architects to sketch your dreams into reality. While our highly experienced Engineering &amp; Quality Assurance teams ensure those dreams are built to unparalleled quality.<br />\n<br />\n&nbsp;<br />\n<strong>BEST CONSTRUCTION MATERIALS</strong><br />\n<br />\nAt SHL, we use the best construction materials without compromise, such as 72 grade Steel; highest grade Portland Composite Cement of only multinational brands; Sylhet Sand for casting (min FM2.5) or Fine Local Sand for finishing works; best quality Ready Mix Concrete (RMC); and custom machine made Solid Cement Concrete Block (CCB) to ensure zero salinity.<br />\n<br />\nFor finishing works, we continuously explore design &amp; material sourcing globally to enhance the comfort and lifestyle of our target customers and joint venture partners. Each material used in our projects is selected with the utmost attention to quality, suitability and durability.<br />\n<br />\n<br />\n<strong>WORLD-CLASS CONSULTANTS</strong><br />\n<br />\nAs part of our commitment to achieving excellence in product quality we engage world-class consultants, both foreign and local, at different stages and areas of development such as Structural Design, Architecture &amp; Interior Design, Electro Mechanical Engineering (EME), Plumbing &amp; Fire Fighting, Landscaping &amp; Lighting and others depending on the specifics of the project.<br />\n&nbsp;<br />\n<br />\n<strong>UNCOMPROMISED SAFETY</strong><br />\n<br />\nOur priority to safety is second to none, especially in the area of Electro Mechanical design and equipment selection such as Elevators, Generators, Substations, as well as Firefighting systems, which are designed by the most reputed EME consultants and only sourced from the world&rsquo;s leading state-of-the-art brands.<br />\n<br />\n<br />\n<strong>ON-TIME DELIVERY</strong><br />\n<br />\nOur commitment to our joint venture partners and customers are absolute in terms of quality and on time delivery. Though a project requires extensive effort in every aspect of its development, especially the design and construction phases, we at SHL always believe efficient project management is key for on time completion. That is why an expert team of highly qualified Engineers and management professionals work relentlessly to ensure this objective.<br />\n&nbsp;</div>\n</div>\n</div>\n</section>\n'),
(10, 'whoweare', 'ABOUT US', 'WHO WE ARE', 'WHO WE ARE', 'WHO WE ARE', 'WHO WE ARE', '329e98ebfd7a74ea7c37d003afa7710f.jpg', 1, '<section class=\"who-we-are-section section-gap bg-grey pb-40\" id=\"who-we-are\">\n<div class=\"container-fluid\">\n<div class=\"mb-40\">\n<h2 class=\"heading-primary text-white\">Who we are</h2>\n</div>\n\n<div class=\"row\">\n<div class=\"col-sm-5 col-md-5 col-sm-46-percent\">\n<div class=\"image-box-holder\">\n<div class=\"image-box \" style=\"background-image: url(http://demo.assignholdings.com/asset/frontend_template/admin/uploads/page/who-we-are/390x500/1495726082tCzkZ.jpg);\">\n<div class=\"inner-content text-white\">\n<p>&nbsp;</p>\n</div>\n</div>\n</div>\n</div>\n\n<div class=\"col-sm-6 col-md-6  col-sm-54-percent image-box-side-content no-pad no-margin\">\n<div class=\"mt-20 content-holder\">\n<p>A powerful portfolio of the country&rsquo;s most distinctive and selective developments, with an excellent reputation in the Real Estate market, and enviable relationships that give our clients exclusive access to the ultimate in luxury apartments and exquisite commercial spaces, all in prime locations of Dhaka city.<br />\n&nbsp;<br />\nOur promise remains to develop a portfolio of luxury spaces and offer investors as well as buyers an unparalleled quality of service, inimitable by competitors. &nbsp;It is the commitment to both impeccably high standards and attention to detail that drive us to our success.<br />\n<br />\nBesides building beyond expectation, SHL moreover sets standards for itself, for you and for others, which is why we proudly declare our driving philosophy to be &quot;Setting Standards&quot;.</p>\n</div>\n</div>\n</div>\n</div>\n</section>\n'),
(11, 'landowners', 'CONTACT', 'Land Owner\'s Query', 'Land Owner\'s Query', 'Land Owner\'s Query', 'Land Owner\'s Query', 'bab09635a141ea6c64a8fb66f52137ca.jpg', 0, ''),
(12, 'buyers', 'CONTACT', 'BUYERS', 'BUYERS', 'BUYERS', 'BUYERS', 'c26cb7a1ba77f330cab9eb91345be47a.jpg', 1, '<section class=\"our-background\" id=\"buyers\">\n<div class=\"clearfix\">\n<div class=\"col-sm-6 no-pad parallax-holder col-sm-46-percent \" style=\"background-image: url(http://demo.assignholdings.com/asset/frontend_template/admin/uploads/page/buyers/1496830763lh1zd.jpg);\">&nbsp;</div>\n\n<div class=\"col-sm-6 no-pad col-sm-push-6 col-sm-54-percent col-sm-push-46-percent \">\n<div class=\"content-holder no-before-after bg-white section-gap-50\">\n<h2 class=\"heading-primary style-1\">Buyers</h2>\nAcquiring an apartment, a home or even an office space is a person&#39;s life-long dream. This dream drives him or her to accumulate the required finance slowly and gradually, which is the start of shaping this dream into reality. This relentless pursuit of realizing such a dream can flow from generation to generation. But finally when a space is purchased, has anyone thought to what extent this &ldquo;dream&rdquo; is actually fulfilled?<br />\n<br />\nWe know that moment is an important stepping-stone for you, and hence we at Shanta Holdings Ltd have been preparing for just that. Our apartments, condominiums and commercial complexes compete with the best that the modern world has to offer.From temperature- controlled swimming pools to lush rooftop gardens and terraces, from state-of- the-art gymnasiums to spacious walkways and children&rsquo;s play facilities, you&rsquo;ll find the solution to your need for stylish urban living with us at SHL.<br />\n<br />\nEven business becomes pleasure in our commercial spaces with central air-conditioning, triple height lobby areas multilayered parking facilities and much more. Show the world you&rsquo;ve arrived, by owning your own little piece of luxury. <!-- <a href=\"#\" class=\"button button-outline button-outline-skyblue mt-30\">Explore</a> --></div>\n</div>\n</div>\n</section>\n'),
(13, 'customers', 'CONTACT', 'CUSTOMERS', 'CUSTOMERS', 'CUSTOMERS', 'CUSTOMERS', 'de2a56fdc337b3d6caa7a76e7119c141.jpg', 1, '<section class=\"pb-0 pt-70 features_amenities no-bg\" id=\"board-of-directors\">\n<div class=\"container-fluid\">\n<div class=\"mb-60\">\n<h2 class=\"heading-primary text-off-white\">&nbsp;</h2>\n</div>\n\n<div class=\"top-management-members row mb-80 image-align-left\">\n<div class=\"col-sm-6 col-md-5 \">\n<div class=\"image-box-holder\">\n<div class=\"image-box no-shadow \" style=\"background-image: url(http://demo.assignholdings.com/asset/frontend_template/admin/uploads/page/customers/1495028525HzqcU.jpg);\">&nbsp;</div>\n</div>\n</div>\n\n<div class=\"col-sm-6 col-md-6 image-box-side-content\">\n<div class=\"feature-details-box-wrapper mb-50\">\n<div class=\"feature-details mt-20\">\n<div class=\"mb-30\">\n<h3 class=\"board-member-title text-uppercase\">Customers</h3>\n\n<h4 class=\"board-member-desig text-uppercase\">&nbsp;</h4>\n</div>\n\n<div class=\"line line--full line--1 line--grey mb-20\">&nbsp;</div>\n\n<div class=\"board-member-details\">We continuously strive to ensure your comfort and satisfaction, which is why we value every feedback from your end. For any customer service or FMS related inquiries regarding your apartment or commercial space, please get in touch at:<br />\n<br />\nEmail: cs@assignholdings.com, fms@assignholdings.com</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</section>\n'),
