(41, 'contact', 'a:3:{s:4:\"Name\";s:12:\"Monica Brown\";s:5:\"Email\";s:28:\"m.brown@explainthebiz.online\";s:7:\"Message\";s:776:\"I messaged previously about how explainer videos became an absolute must for every website in 2020. Driving relevant traffic to your site is hard enough, you must capture this traffic and engage them! \n \n \nAs you know, Google is constantly changing its SEO algorithm. The only thing that has remained consistent is that adding an explainer video increases website rank and most importantly keeps customers on your page for longer, increasing conversions ratios. \n \n \nMy team has created thousands of marketing videos including dozens in your field. Simplify your pitch, increase website traffic, and close more business. \n \n \nShould I send over some industry-specific samples? \n \n \n-- Monica Brown \n \n \nEmail: M.Brown@explainthebiz.online \nWebsite: http://explainthebiz.online\";}', 0, '2020-03-03 10:03:55'),
(42, 'contact', 'a:3:{s:4:\"Name\";s:15:\"Philip Anderson\";s:5:\"Email\";s:27:\"storybitestudio14@gmail.com\";s:7:\"Message\";s:1211:\"Hi there, I came across your website and wanted to get in touch. \n \nI run an animation studio that makes animated explainer videos helping companies to better explain their offering and why potential customers should work with them over the competition. \n \nWatch some of our work here: http://www.story-bite.com/ - what do you think about it? \n \nOur team works out of Denmark to create high quality videos made from scratch, designed to make your business stand out and get results. No templates, no cookie cutter animation that tarnishes your brand. \n \nI really wanted to make you a super awesome animated video explaining what your company does and the value behind it. \n \nWe have a smooth production process and handle everything needed for a high-quality video that typically takes us 6 weeks to produce from start to finish. \n \nFirst, we nail the script, design storyboards you can’t wait to see animated. Voice actors in your native language that capture your brand and animation that screams premium with sound design that brings it all together. \n \nIf you’re interested in learning more visit our website or please get in touch on the email below: \nEmail: storybiteanimations@gmail.com \n \nThank you!\";}', 0, '2020-03-06 03:34:11');
