INSERT INTO `siteinfo` (`id`, `name`, `metatitle`, `metakeys`, `metadescription`, `logo`, `favicon`, `phone`, `address`, `email`) VALUES
(1, 'Assign Holdings Ltd', 'Assign Holdings Ltd | Best in real estate company in Dhaka', 'real estate, best home, real estate company Bangladesh, flat buy in Dhaka, flat sale in Dhaka, Dhaka real estate, Gulshan property, Banani property, Uttara property, Dhanmondi property, buy flat Dhaka, apartment for sale Dhaka, property investment Dhaka, premium flats Dhaka, Assign Holdings, Assign Realtor', 'a trusted real estate company in Dhaka delivering quality developments, secure investments, and exceptional client satisfaction.', '428240590909918c81247bbd879d7f1b.png', 'de71b709dfa3ea19b4ba3760551e5c28.png', '+88 02 8415866,  +88 02 8415867', 'Icon Centre,  3rd Floor,  57/4 Progati Sharani,  Baridhara, Dhaka, Bangladesh. (Infront of Jamuna future park)', 'info@assignholdings.com');
INSERT INTO `why` (`id`, `title`, `description`, `status`) VALUES
(1, 'IMPRESSIVE LANDMARKS', 'We are dedicated to redefine lifestyle, by providing international standard residential and commercial spaces that are very functional. From the begginging of planning we select prestigious areas full of modern amenities of life, lifestyle facilities that ensures luxury and comfort to our honorable customer. Our Land selection is very good as we believe in the best.', 1),
(3, 'STATE-OF-THE ART ARCHITECTURE', 'Quality is our core principle and architecture is our passion. We endeavor to offer global standard architectural design solutions whilst keeping the local culture in mind. We believe that every project is unique; hence unique architectural requirements may arise. Thus, we work very closely with a panel of the leading Architects to sketch your dreams into reality. While our highly experienced Engineering & Quality Assurance teams ensure those dreams are built to unparalleled quality.', 1),
(4, 'EFFICIENT PROFESSIONALS', 'Our personals are a primary reason our clients recommend Assign to others. Their unique skills and infectious energy help our clients focus on what matters most and build their capability and confidence to create winning firms of the future. Our personals always dedicated to make our clients happy by providing proper project detailed information. It feels different to work with us.', 1),
(5, 'BEST CONSTRUCTION MATERIALS', 'We use the best construction materials without compromise, such as 72 grade Steel; highest grade Portland Composite Cement of only multinational brands; Sylhet Sand for casting (min FM2.5) or Fine Local Sand for finishing works; best quality Ready Mix Concrete (RMC); and custom machine made Solid Cement Concrete Block (CCB)  to ensure zero salinity. For finishing works, we continuously explore design & material sourcing globally to enhance the comfort and lifestyle of our target customers and joint venture partners. Each material used in our projects is selected with the utmost attention to quality,  suitability and durability.', 1),
(6, 'ON-TIME DELIVERY', 'As we always perform perfect project management, we are strongly committed to our client and landowner to complete the project in time. We believe project handover within the proposed schedule makes us more happy than our client. So we give proper attention in this respect.', 1),
(7, 'AFTER SALES SERVICE', 'Our close relationship with our customer does not end once our project are delivered — it is only just beginning. Because wherever our ptoject are, you will also put employees on site, making sure the customer is satisfied with the product. We perform Preventive maintenance round out our after-sales service..', 1);
